#   Nota bene, la conversione della data dal formato aaaa/mm/gg al numero di giorni
#   trascorsi dal 1/gen/2010 è un punto fondamentale dell'esercizio.
#   Per la conversione, assumete che i mesi dell'anno abbiano il numero di giorni
#   indicati nella seguente struttura dati:
#   {1:31, 2:28, 3:31, 4:30, 5:31, 6:30, 7:31, 8:31, 9:30, 10:31, 11:30, 12:31}
#   dove: la coppia 1:31 indica che il mese di gennaio ha 31 giorni:
#   la coppia 2:28 indica che il mese di febbraio ha 28 giorni;
#   ...
#   e la coppia 12:31 indica che il mese di dicembre ha 31 giorni.
